import Foundation

/// 5382. HTML 实体解析器 中等
///
/// [url](https://leetcode-cn.com/problems/html-entity-parser/)
///
/// 「HTML 实体解析器」 是一种特殊的解析器，它将 HTML 代码作为输入，并用字符本身替换掉所有这些特殊的字符实体。
///
///  HTML 里这些特殊字符和它们对应的字符实体包括：
///
///  - 双引号：字符实体为 `&quot;`，对应的字符是 `"`。
///  - 单引号：字符实体为 `&apos;`，对应的字符是 `'`。
///  - 与符号：字符实体为 `&amp;`，对应对的字符是 `&`。
///  - 大于号：字符实体为 `&gt;`，对应的字符是 `>`。
///  - 小于号：字符实体为 `&lt;`，对应的字符是 `<`。
///  - 斜线号：字符实体为 `&frasl;`，对应的字符是 `/`。
///
///  给你输入字符串 `text` ，请你实现一个 HTML 实体解析器，返回解析器解析后的结果。
///
/// - Parameter words:
/// - Returns:
func entityParser(_ text: String) -> String {
    
    let entitys: [String: String] = [
        "&quot;"  : "\"",
        "&apos;"  : "'",
        "&amp;"   : "&",
        "&gt;"    : ">",
        "&lt;"    : "<",
        "&frasl;" : "/"
    ]
    
    var result = ""
    var tmp = ""
    var start = false
    
    text.forEach {
        
        switch $0 {
        
        case "&":
            tmp.append($0)
            start = true
            
        case ";":
            tmp.append($0)
            start = false
            
            if let realString = entitys[tmp] {
                result.append(realString)
            } else {
                result.append(tmp)
            }
            
            tmp = ""
            
        default:
            if start {
                tmp.append($0)
            } else {
                result.append($0)
            }
        }
    }
    
    return result
}

/// 直接调用库函数 replace 方法
func entityParser2(_ text: String) -> String {
    
    var string = text
    
    let entitys: [String: String] = [
        "&quot;"  : "\"",
        "&apos;"  : "'",
        "&amp;"   : "&",
        "&gt;"    : ">",
        "&lt;"    : "<",
        "&frasl;" : "/"
    ]
    
    for (key, value) in entitys {
        string = string.replacingOccurrences(of: key, with: value)
    }
    
    return string
}

// "& is an HTML entity but &ambassador; is not."
print(entityParser("&amp; is an HTML entity but &ambassador; is not."))

// "and I quote: \"...\""
print(entityParser("and I quote: &quot;...&quot;"))

// "Stay home! Practice on Leetcode :)"
print(entityParser("Stay home! Practice on Leetcode :)"))

// "x > y && x < y is always false"
print(entityParser("x &gt; y &amp;&amp; x &lt; y is always false"))

